import { Link } from 'react-router-dom'
import './App.css'
import { images, useWindowDimensions } from './constants'
import { useRef } from 'react'

function App() {
  // const { height, width } = useWindowDimensions()

  const placeholderStyle = {
    color: '#d0d0e2',
  }

  const width = useRef(window.innerWidth).current
  const height = useRef(window.innerHeight).current
  return (
    <div className="App">
      <div
        style={{
          display: 'flex',
          height: height * 0.09,
          backgroundColor: '#171544',
          flexDirection: 'row',
          paddingTop: 6,
        }}
      >
        <img
          src={'https://i.imgur.com/hPbfzZ2.png'}
          alt="Logo image T&C"
          style={{
            height: height * 0.09 - 32,
            marginTop: 13,
            marginBottom: 13,
            marginLeft: 10,
            marginRight: 13,
          }}
        />
        <Link to="/PushImage" style={{ textDecoration: 'none' }}>
          <div
            style={{
              display: 'flex',
              flexDirection: 'row',
              height: height * 0.09 - 32,
              width: width * 0.076,
              marginTop: 13,
              marginBottom: 13,
              backgroundColor: '#1bb76e',
              marginLeft: 15,
              borderRadius: 3,
              boxShadow: '0px 2px 6px rgba(1,1,1, 0.3)',
            }}
          >
            <img
              src={images.add_new_image}
              style={{
                marginLeft: 5,
                height: height * 0.09 - 36,
                alignSelf: 'center',
              }}
            />
            <span
              style={{
                fontSize: 13,
                color: '#fff',
                fontWeight: '500',
                alignSelf: 'center',
                marginLeft: 5,
              }}
            >
              Push Image
            </span>
          </div>
        </Link>

        <div
          style={{
            flex: 1,
            height: height * 0.09,
          }}
        >
          <form action="/search">
            <div
              style={{
                height: height * 0.09 - 6,
                alignItems: 'center',
                justifyContent: 'center',
                display: 'flex',
              }}
            >
              <input
                type="text"
                placeholder="Images, #tags, @users oh my!"
                style={{
                  height: height * 0.09 - 33,
                  width: width * 0.32,
                  backgroundColor: '#454469',
                  padding: '0px  0px 0px 10px',
                  border: '1px solid transparent',
                  borderRadius: '3px',
                  outline: '0',
                  opacity: '0.8',
                  fontSize: '15px',
                  fontWeight: '400',
                  letterSpacing: '0.4px',
                  color: '#fff',
                  textShadow: 'inherit',
                  boxShadow: '0px 2px 6px rgba(32,32,32, 0.3)',
                }}
              />
              <style>{`input::placeholder {
            color: ${placeholderStyle.color};
            padding: ${placeholderStyle.padding}; }`}</style>

              <img
                src={images.search}
                style={{
                  height: height * 0.09 - 45,
                  filter: 'invert(100%)',
                  padding: 10,
                }}
              />
            </div>
          </form>
        </div>

        <div
          style={{
            width: width * 0.16,
            display: 'flex',
            flexDirection: 'row',
            justifyContent: 'center',
            alignItems: 'center',
            backgroundColor: 'red',
          }}
        >
          <img
            src={images.login}
            style={{
              height: height * 0.09 - 38,
              paddingLeft: 10,
              paddingRight: 10,
              filter: 'invert(100%)',
              marginBottom: 3,
            }}
          />

          <img
            src={images.bell}
            style={{
              height: height * 0.09 - 38,
              paddingLeft: 10,
              paddingRight: 10,
              filter: 'invert(100%)',
            }}
          />
          <div
            style={{
              flex: 1,
              display: 'flex',
              flexDirection: 'row',
              justifyContent: 'flex-end',
            }}
          >
            <p
              style={{
                alignSelf: 'center',
                fontSize: 15,
                color: '#f7f6f6',
                fontWeight: 'bold',
                marginLeft: 10,
                marginRight: 10,
              }}
            >
              the joker
            </p>
            <img
              src={images.user}
              style={{
                height: height * 0.09 - 23,
                alignSelf: 'center',
                marginRight: 15,
                boxShadow: '0px 2px 6px rgba(1,1,1, 0.4)',
              }}
            />
          </div>
        </div>
      </div>
      <div
        style={{
          height: height * 0.1,
          backgroundColor: '#171544',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <p
          style={{
            color: '#acd7ea',
            fontWeight: 'bold',
            fontSize: 20,
          }}
        >
          The only sensible way to live in this world is without rules.
        </p>
      </div>
      <div
        style={{
          backgroundColor: '#171544',
          height: height * 0.26,
          paddingLeft: width * 0.05,
          fontWeight: 'bold',
          paddingRight: 25,
        }}
      >
        <span
          style={{
            float: 'left',
            color: '#8e8cbb',
            textTransform: 'uppercase',
          }}
        >
          EXPLORE TAGS
        </span>
        <div style={{}}></div>
      </div>
    </div>
  )
}

export default App
